import React from 'react'
import Questions from '../../Data'
console.log(Questions)
const Sampe = (questionText) => {
    
    {
        Questions.map((user)=>(
            <p>{user.questionText}</p>
        ))
    }
  return (
    <div>Sampe</div>
  )
}

export default Sampe
